folgreich gespeichert!\";\n        }\n\n        $balance = $this->accountBusinessFacade->calculateBalance($this->getLoggedInUser()->getId());\n\n        return $this->render('deposit.html.twig', [\n            'title' => 'Deposit Controller',\n            'balance' => $balance,\n            'loginStatus' => $this->accountBusinessFacade->getLoginStatus(),\n            'success' => $success,\n            'error' => $error,\n        ]);\n    }\n}","mutants":[{"id":"ae2cc872a404b3cb283357f4c8577468","mutatorName":"PublicVisibility","replacement":"protected function action(Request $request) : Response","description":"Replaces the `public` method visibility keyword with `protected`.","location":{"start":{"line":34,"column":5},"end":{"line":34,"column":42}},"status":"Killed","statusReason":"PHPUnit 9.6.13 by Sebastian Bergmann and contributors.\n\nTesting \nE\n\nTime: 00:00.086, Memory: 24.00 MB\n\nThere was 1 error:\n\n1) App\\Tests\\src\\Component\\Account\\Communication\\DepositControllerTest::testAction\nTypeError: Symfony\\Bundle\\FrameworkBundle\\KernelBrowser::loginUser(): Argument #1 ($user) must be of type object, null given, called in \/home\/simondewendt\/PhpstormProjects\/CashAppSymfony\/tests\/src\/Component\/Account\/Communication\/DepositControllerTest.php on line 17\n\n\/home\/simondewendt\/PhpstormProjects\/CashAppSymfony\/vendor\/symfony\/framework-bundle\/KernelBrowser.php:114\n\/home\/simondewendt\/PhpstormProjects\/CashAppSymfony\/tests\/src\/Component\/Account\/Communication\/DepositControllerTest.php:17\n\nERRORS!\nTests: 1, Assertions: 0, Errors: 1.\n\nRemaining indirect deprecation notices (1)\n\n  1x: The \"Monolog\\Logger\" class is considered final. It may change without further notice as of its next major version. You should not extend it from \"Symfony\\Bridge\\Monolog\\Logger\".\n    1x in DepositControllerTest::testAction from App\\Tests\\src\\Component\\Account\\Communication","coveredBy":["08333444c65b34c91fdbcb2069255f5f","e79c5016321fdc4
